import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import web from "../src/images/travel.jpg";
import Common from './Common';


const Home = () => {
    return(
    <div>
         <Common
         name="share Your Travel Experience"
         imgsrc={web}
         visit="/Service"
         btname="Get Started"
         />
    </div>
    );
}
 
export default Home ;
